window.bookSummaryJSON = "<p>The princess isn’t supposed to dethrone the king.&nbsp;</p> <p><b>Elsa</b>&nbsp;</p> <p>He said he’ll destroy me, and he did.&nbsp;</p> <p>I might have lost the battle, but the war is far from over.&nbsp;</p> <p>They say it starts with one move to dethrone the king.&nbsp;</p> <p>No one mentioned he’ll yank me with him on the way down.&nbsp;</p> <p><b>Aiden</b>&nbsp;</p> <p>If Steel’s little princess wants a war, then war it is.&nbsp;</p> <p>There’s only one rule: my rules or none at all.&nbsp;</p> <p>By all means, show me what you got, sweetheart.&nbsp;</p> <p><i>Steel Princess </i>is book two of Royal Elite series and should be listened to after <i>Deviant King</i>. This is a dark high-school bully romance, mature new adult, and contains dubious situations that some listeners might find offensive.&nbsp;</p> <p>This audiobook is part of a trilogy and is not a stand-alone.&nbsp;</p> <p>The entire trilogy is available.</p>"; 
